import React from "react";
import human from "../../../Image/human.jpg";
import human2 from "../../../Image/human2.jpg";
import "./NavTop.css";
import List from "../List/List";
import Modal from "../Modal/Modal";

const NavTop = () => {
  return (
    <div className="navtop">
      <div className="row in-profile">
        <div className="col ">
          <img src={human} alt="" width="65" className="rounded-circle" />
          <button
            type="button"
            class="btn float-right toggle-modal shadow-none"
            data-toggle="modal"
            data-target="#a"
          >
            <i
              className="fa fa-bars icon float-right"
              // style={{ color: "white" }}
            ></i>
          </button>
          {/* <Modal/> */}
        </div>
      </div>
    </div>
  );
};

export default NavTop;
